import React from 'react';
import styled from 'styled-components';
import { HeadText } from './WayToCome';
import { Hr } from './Calender';

export default function Contact() {
  return (
    <>
      <ContactWrapper>
        <HeadText>마음 전하실 곳</HeadText>
        <Hr />
        <DropContainer>
          <GroomtCover>신랑측</GroomtCover>
          <BridaltCover>
            <BridalText>신부측</BridalText>
          </BridaltCover>
        </DropContainer>
      </ContactWrapper>
    </>
  );
}

export const ContactWrapper = styled.div`
  width: 100%;
  background-color: #fefbf8;
  padding-top: 4rem;
`;

export const DropContainer = styled.div`
  margin-top: 4rem;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`;

export const GroomtCover = styled.button`
  width: 20rem;
  height: 3.5rem;
  background-color: #e6e7dd;
  display: flex;
  align-items: center;
  color: #595d3b;
  font-size: 0.9rem;
`;

// export const GroomText = styled.h3`
//   color: #595d3b;
//   font-size: 0.9rem;
// `;

export const BridaltCover = styled.button`
  width: 20rem;
  height: 3.5rem;
  background-color: #efeae2;
  margin-top: 0.5rem;
`;

export const BridalText = styled.h3`
  color: #856442;
  font-size: 0.9rem;
`;
